yment obligations from us with a designated third-party financial institution. Participating suppliers may, at their sole discretion, make offers to finance one or more of our payment obligations prior to their scheduled due dates at a discounted price. Our obligations to our suppliers, including amounts due and scheduled payment dates, are not impacted by suppliers’ decisions to finance amounts under these arrangements. The terms of payments are consistent with the terms of our trade payables. Activity related to the obligations is presented within operating activities on the consolidated statements of cash flows.','null'),('0000056873','KROGER CO','0',NULL,'null'),('0001050915','QUANTA SERVICES, INC.','0',NULL,'null'),('0000815556','FASTENAL CO','0',NULL,'null'),('0000026172','CUMMINS INC','1',NULL,'[[\"In millions\", \"\", \"\"], [\"Balance at December 31, 2022\", \"\", \"$\", \"331\", \"\"], [\"Additional invoices presented for payment\", \"\", \"1,141\", \"\"], [\"Payments to financial intermediaries\", \"\", \"(1,274)\", \"\"], [\"Foreign currency translation adjustments and other\", \"\", \"1\", \"\"], [\"Balance at December 31, 2023\", \"\", \"$\", \"199\", \"\"]]'),('0000073309','NUCOR CORP','0',NULL,'null'),('0000047111','HERSHEY CO','1','Supplier Finance Program ObligationsDuring 2020, we entered into an agreement with two third-party financial institutions to facilitate a supplier finance program which allows qualifying suppliers to sell their receivables from the Company to the financial institution. These participating suppliers negotiate their outstanding receivable arrangements directly with the financial institution, and our rights and obligations to our suppliers are not impacted.  We have no economic interest in a supplier’s decision to enter into these agreements.  Once a qualifying supplier elects to participate in the supplier finance program and reaches an agreement with a financial institution, they elect which individual Company invoices they sell to the financial institution.  However, all Company payments to participating suppliers are paid to the financial institution on the invoice due date, regardless of whether the individual invoice is sold by the supplier to the financial institution.  The financial institution pays the supplier on the invoice due date for any invoices that were not previously sold under the supplier finance program.  Our obligations to our suppliers, including amounts due and scheduled payment terms, are not impacted by our suppliers’ decisions to sell amounts under these arrangements.  The payment of these obligations is included in cash provided by operating activities in the Consolidated Statements of Cash Flows.','null'),('0001090872','AGILENT TECHNOLOGIES, INC.','0',NULL,'null'),('0001755672','Corteva, Inc.','0',NULL,'null'),('0000024741','CORNING INC /NY','0',NULL,'null'),('0001751788','DOW INC.','1',NULL,'[[\"Supplier Finance Program Activity\", \"2023\", \"\"], [\"In millions\"], [\"Confirmed obligations outstanding at Jan 1\", \"$\", \"267\", \"\", \"\"], [\"Invoices confirmed to financial intermediary\", \"1,308\", \"\", \"\"], [\"Confirmed invoices paid to financial intermediary\", \"(1,290)\", \"\", \"\"], [\"Confirmed obligations outstanding at Dec 31\", \"$\", \"285\", \"\", \"\"]]'),('0000712515','ELECTRONIC ARTS INC.','0',NULL,'null'),('0000788784','PUBLIC SERVICE ENTERPRISE GROUP INC','0',NULL,'null'),('0000049938','IMPERIAL OIL LTD','0',NULL,'null'),('0000047217','HP INC','0',NULL,'null'),('0001932393','GE HealthCare Technologies Inc.','1','SUPPLY CHAIN FINANCE PROGRAMS. The Company participates in voluntary supply chain finance programs which provide participating suppliers the opportunity to sell their GE HealthCare receivables to third parties at the sole discretion of both the suppliers and the third parties. We evaluate supply chain finance programs to ensure the use of a third-party intermediary to settle our trade payables does not change the nature, existence, amount, or timing of our trade payables and does not provide the Company with any direct economic benefit. If any characteristics of the trade payables change or we receive a direct economic benefit, we reclassify the trade payables as borrowings. In connection with the supply chain finance programs, payment terms normally range from 30 to 150 days, not exceeding 180 days, depending on the underlying supplier agreements.','null'),('0001834584','Coupang, Inc.','0',NULL,'null'),('0001058290','COGNIZANT TECHNOLOGY SOLUTIONS CORP','0',NULL,'null'),('0001289490','Extra Space Storage Inc.','0',NULL,'null'),('0000096021','SYSCO CORP','0',NULL,'null'),('0000749251','GARTNER INC','0',NULL,'null'),('0001120193','NASDAQ, INC.','0',NULL,'null'),('0000947484','ARCH CAPITAL GROUP LTD.','0',NULL,'null'),('0001001250','ESTEE LAUDER COMPANIES INC','0',NULL,'null'),('0001635327','Flutter Entertainment plc','0',NULL,'null'),('0001109357','EXELON CORP','0',NULL,'null'),('0000040704','GENERAL MILLS INC','0',NULL,'null'),('0001701605','Baker Hughes Co','0',NULL,'null'),('0001041061','YUM BRANDS INC','0',NULL,'null'),('0001397187','lululemon athletica inc.','0',NULL,'null'),('0001539838','Diamondback Energy, Inc.','0',NULL,'null'),('0001393612','Discover Financial Services','0',NULL,'null'),('0000916076','MARTIN MARIETTA MATERIALS INC','0',NULL,'null'),('0001944048','Kenvue Inc.','0',NULL,'null'),('0001396009','Vulcan Materials CO','0',NULL,'null'),('0001071739','CENTENE CORP','0',NULL,'null'),('0001524472','Xylem Inc.','0',NULL,'null'),('0001674101','Vertiv Holdings Co','0',NULL,'null'),('0001666700','DuPont de Nemours, Inc.','0',NULL,'null'),('0000004281','Howmet Aerospace Inc.','0',NULL,'null'),('0000033185','EQUIFAX INC','0',NULL,'null'),('0001121788','GARMIN LTD','0',NULL,'null'),('0000875045','BIOGEN INC.','0',NULL,'null'),('0001047862','CONSOLIDATED EDISON INC','0',NULL,'null'),('0001618756','Restaurant Brands International Inc.','0',NULL,'null'),('0001705696','VICI PROPERTIES INC.','0',NULL,'null'),('0001097864','ON SEMICONDUCTOR CORP','0',NULL,'null'),('0001489393','LyondellBasell Industries N.V.','1','Supply Chain Finance ArrangementsIn an effort to maintain a strong and efficient supply chain, we facilitate a voluntary supply chain finance program that provides suppliers, at their sole discretion, the opportunity to sell their receivables due from us to a participating financial intermediary in order to be paid earlier than our contracted payment terms. We are not a party to any agreement between our suppliers and the financial intermediary. When a supplier utilizes the program and receives an early payment from the financial intermediary, the supplier takes a discount on the invoice. We pay the financial intermediary the full amount of the invoice on the contractually agreed upon due date. The majority of the suppliers using the program are on 90-day payment terms. There is no economic impact to the Company from a supplier’s decision to take an early payment. No guarantees are provided by us or any of our subsidiaries under the program.','null'),('0001024478','ROCKWELL AUTOMATION, INC','0',NULL,'null'),('0001402057','CDW Corp','0',NULL,'null'),('0000007084','Archer-Daniels-Midland Co','1',NULL,'[[\"\", \"Year Ended December 31\"], [\"\", \"2023\"], [\"\", \"(In millions)\"], [\"Beginning, January 1\", \"$\", \"196\", \"\"], [\"Obligations confirmed\", \"1,100\", \"\"], [\"Obligations paid\", \"(1,022)\", \"\"], [\"Ending, December 31\", \"$\", \"274\", \"\"], [\"\", \"\"]]'),('0001057352','COSTAR GROUP, INC.','0',NULL,'null'),('0000072903','XCEL ENERGY INC','0',NULL,'null'),('0000943819','RESMED INC','0',NULL,'null'),('0001050446','MICROSTRATEGY Inc','0',NULL,'null'),('0001300514','LAS VEGAS SANDS CORP','0',NULL,'null'),('0001138118','CBRE GROUP, INC.','0',NULL,'null'),('0001393052','VEEVA SYSTEMS INC','0',NULL,'null'),('0001389170','Targa Resources Corp.','0',NULL,'null'),('0000874766','HARTFORD FINANCIAL SERVICES GROUP, INC.'