0001383650','Cheniere Energy Partners, L.P.','0',NULL,'null'),('0000783325','WEC ENERGY GROUP, INC.','0',NULL,'null'),('0001123360','GLOBAL PAYMENTS INC','0',NULL,'null'),('0000051253','INTERNATIONAL FLAVORS & FRAGRANCES INC','1','Supply Chain Financing ProgramIn the fourth quarter of 2023, the Company entered into a supply chain financing (“SCF”) program. The program is expected to be available to U.S. based suppliers starting in the second quarter of 2024. The Company makes continuous efforts to improve working capital efficiency and has worked with suppliers to optimize payment terms and conditions. The Company’s current payment terms with a majority of suppliers generally range from 0 to 180 days, which is deemed to be commercially reasonable. The Company’s voluntary SCF program will allow its suppliers to elect to sell the receivables owed to them by the Company to a third-party financial institution. The suppliers, at their own discretion, will determine the invoices they want to sell and directly negotiate the arrangements with the participating third-party financial institution. Supplier participation in the program is solely the decision of the supplier and has no bearing on the Company’s payment terms and amounts due with the supplier. The Company’s responsibility will be limited to making payments based upon the agreed upon contractual terms and arrangements. The Company will not provide any form of guarantees under the SCF program and will have no economic interest in the suppliers’ decision to participate in the SCF program. Amounts due to suppliers that elect to participate in the SCF program will be included in Accounts payable on the Consolidated Balance Sheets. The Company, or the third-party financial institution, may choose to terminate the agreement of the program at any time upon 30 days’ prior written notice. The third-party financial institution may also terminate the agreement of the program at any time upon three business days’ prior written notice in the event there are insufficient funds available for disbursements. As of December 31, 2023 and 2022, there were no amounts outstanding related to suppliers’ participation in the SCF program.','null'),('0000815097','CARNIVAL CORP','0',NULL,'null'),('0000093751','STATE STREET CORP','0',NULL,'null'),('0001404655','HUBSPOT INC','0',NULL,'null'),('0000029905','DOVER Corp','0',NULL,'null'),('0001967680','Veralto Corp','0',NULL,'null'),('0001236275','QXO, Inc.','0',NULL,'null'),('0000313927','CHURCH & DWIGHT CO INC /DE/','0',NULL,'null'),('0001601046','Keysight Technologies, Inc.','0',NULL,'null'),('0001069183','AXON ENTERPRISE, INC.','0',NULL,'null'),('0000084839','ROLLINS INC','0',NULL,'null'),('0001383312','BROADRIDGE FINANCIAL SOLUTIONS, INC.','0',NULL,'null'),('0000936340','DTE ENERGY CO','0',NULL,'null'),('0001758730','Tradeweb Markets Inc.','0',NULL,'null'),('0001274494','FIRST SOLAR, INC.','0',NULL,'null'),('0000097210','TERADYNE, INC','0',NULL,'null'),('0001564408','Snap Inc','0',NULL,'null'),('0000106040','WESTERN DIGITAL CORP','0',NULL,'null'),('0000065984','ENTERGY CORP /DE/','0',NULL,'null'),('0000721371','CARDINAL HEALTH INC','0',NULL,'null'),('0000935703','DOLLAR TREE, INC.','0',NULL,'null'),('0001837240','Symbotic Inc.','0',NULL,'null'),('0000720005','RAYMOND JAMES FINANCIAL INC','0',NULL,'null'),('0000105770','WEST PHARMACEUTICAL SERVICES INC','0',NULL,'null'),('0001031296','FIRSTENERGY CORP','0',NULL,'null'),('0001757898','STERIS plc','0',NULL,'null'),('0001136869','ZIMMER BIOMET HOLDINGS, INC.','0',NULL,'null'),('0000910521','DECKERS OUTDOOR CORP','0',NULL,'null'),('0000860731','TYLER TECHNOLOGIES INC','0',NULL,'null'),('0001687229','Invitation Homes Inc.','0',NULL,'null'),('0001125259','CARNIVAL PLC','0',NULL,'null'),('0001137789','Seagate Technology Holdings plc','0',NULL,'null'),('0001034054','SBA COMMUNICATIONS CORP','0',NULL,'null'),('0000106535','WEYERHAEUSER CO','0',NULL,'null'),('0001335258','Live Nation Entertainment, Inc.','0',NULL,