spectively. All payments made under the program are recorded as a decrease in accounts payable and accrued liabilities, net, in our consolidated statements of cash flows.','null'),('0001996862','Bunge Global SA','0',NULL,'null'),('0001022079','QUEST DIAGNOSTICS INC','0',NULL,'null'),('0001468174','Hyatt Hotels Corp','0',NULL,'null'),('0001552033','TransUnion','0',NULL,'null'),('0000033213','EQT Corp','0',NULL,'null'),('0001370946','Owens Corning','1','Supplier Finance ProgramsWe review supplier terms and conditions on an ongoing basis, and have negotiated payment terms extensions in recent years in connection with our efforts to reduce working capital and improve cash flow. Separate from those terms extension actions, certain of our subsidiaries have entered into paying agency agreements with third-party administrators. These voluntary supply chain finance programs (collectively, the “Programs”) generally give participating suppliers the ability to sell, or otherwise pledge as collateral, their receivables from the Company to the participating financial institutions, at the sole discretion of both the suppliers and financial institutions. The Company is not a party to the arrangements between the suppliers and the financial institutions. The Company’s obligations to its suppliers, including amounts due and scheduled payment dates, are not impacted by the suppliers’ decisions to sell, or otherwise pledge as collateral, amounts under these arrangements. The Company\'s payment terms to the financial institutions, including the timing and amount of payments, are based on the original supplier invoices. One of our programs includes a parent guarantee to the participating financial institution for a certain U.S. subsidiary that, at the time of the respective program’s inception in 2015, was a guarantor subsidiary of the Company’s Credit Agreement. The obligations are presented as Accounts payable within Total current liabilities on the Consolidated Balance Sheets and all 