'0000866374','FLEX LTD.','0',NULL,'null'),('0000059527','LINCOLN ELECTRIC HOLDINGS INC','1','NOTE 19 – SUPPLIER FINANCING PROGRAM​The Company’s suppliers, at the supplier’s sole discretion, are able to factor receivables due from the Company to a financial institution on terms directly negotiated with the financial institution without affecting the Company’s balance sheet classification of the corresponding payable. The Company pays the financial institution the stated amount of the confirmed invoices from its designated suppliers on the original maturity dates of the invoices. Invoices with suppliers have terms between 120 and 180 days. The Company does not provide secured legal assets or other forms of guarantees under the arrangement and has no involvement in establishing the terms or conditions of the arrangement between its suppliers and the financial institution. The amounts due to the financial institution for suppliers that participate in the supplier financing program are included in Trade accounts payable on the Company’s Consolidated Balance Sheets, and the associated payments are included in operating activities in the Consolidated Statements of Cash Flows. At December 31, 2023 and December 31, 2022, Trade accounts payable included $29,111 and $33,475, respectively, payable to suppliers that have elected to participate in the supplier financing program.​','null'),('0001035983','COMFORT SYSTEMS USA INC','0',NULL,'null'),('0000216228','ITT INC.','0',NULL,'null'),('0001673358','Yum China Holdings, Inc.','0',NULL,'null'),('0001646972','Albertsons Companies, Inc.','0',NULL,'null'),('0001069157','EAST WEST BANCORP INC','0',NULL,'null'),('0001289460','Texas Roadhouse, Inc.','0',NULL,'null'),('0001261333','DOCUSIGN, INC.','0',NULL,'null'),('0000096223','Jefferies Financial Group Inc.','0',NULL,'null'),('0001100682','CHARLES RIVER LABORATORIES INTERNATIONAL, INC.','0',NULL,'null'),('0000915389','EASTMAN CHEMICAL CO','0',NULL,'null'),('0001841666','APA Corp','0',N