,'null'),('0001019849','PENSKE AUTOMOTIVE GROUP, INC.','0',NULL,'null'),('0001611052','PROCORE TECHNOLOGIES, INC.','0',NULL,'null'),('0001447669','TWILIO INC','0',NULL,'null'),('0001048695','F5, INC.','0',NULL,'null'),('0000005513','Unum Group','0',NULL,'null'),('0000016058','CACI INTERNATIONAL INC /DE/','0',NULL,'null'),('0001219601','CROWN HOLDINGS, INC.','0',NULL,'null'),('0001507079','Floor & Decor Holdings, Inc.','1','Supply Chain FinanceThe Company facilitates supply chain finance programs through financial intermediaries, which provide certain suppliers the option to be paid by the financial intermediaries earlier than the due date on the applicable invoice. When a supplier utilizes one of the supply chain finance programs and receives an early payment from a financial intermediary, it takes a discount on the invoice. The Company then pays the financial intermediary the invoice on the original due date. The Company does not reimburse suppliers for any costs they incur for participation in the program. Supplier participation is voluntary, and there are no assets pledged as security or other forms of guarantees provided for the committed payment to the financial intermediaries. As a result, all amounts owed to the financial intermediaries are presented as trade accounts payable in the Consolidated Balance Sheets. Amounts due to the financial intermediaries reflected in trade accounts payable at December 28, 2023 and December 29, 2022 were $114.0 million and $82.5 million, respectively.','null'),('0000082811','REGAL REXNORD CORP','1','Supplier Finance ProgramThe Company\'s supplier finance program with Bank of America (the \"Bank\") offers the Company\'s designated suppliers the option to receive payments of outstanding invoices in advance of the invoice maturity dates at a discount. The Company\'s payment obligation to the Bank remains subject to the respective supplier\'s invoice maturity date. The Bank acts as a payment agent, making payments on invoices the Company confirms are valid. The supplier finance program is offered for open account transactions only and may be terminated by either the Company or the Bank upon 15 days notice. The Company has not pledged any assets under this program. The Company has not incurred any subscription, service or other fees related to the Company\'s supplier finance program. The Company\'s outstanding obligations under the supplier finance program, which are classified within Accounts Payable, were $60.8 million and $69.9 million as of December 31, 2023 and December 31, 2022, respectively.','null'),('0001043219','ANNALY CAPITAL MANAGEMENT INC','0',NULL,'null'),('0001600033','e.l.f. Beauty, Inc.','0',NULL,'null'),('0001047127','AMKOR TECHNOLOGY, INC.','0',NULL,'null'),('0001177394','TD SYNNEX CORP','0',NULL,'null'),('0001065837','SKECHERS USA INC','0',NULL,'null'),('0001302215','HOULIHAN LOKEY, INC.','0',NULL,'null'),('0000737758','TORO CO','0',NULL,'null'),('0001237831','GLOBUS MEDICAL INC','0',NULL,'null'),('0000317540','Coca-Cola Consolidated, Inc.','1','Supply Chain Finance ProgramThe Company has an agreement with a third-party financial institution to facilitate a supply chain finance (“SCF”) program, which allows qualifying suppliers to sell their receivables from the Company to the financial institution. The participating suppliers negotiate their outstanding receivable arrangements and associated fees directly with the financial institution, and the Company is not party to those agreements. Once a qualifying supplier elects to participate in the SCF program and reaches an agreement with the financial institution, the supplier elects which individual Company invoices it sells to the financial institution. The supplier invoices that have been confirmed as valid under the SCF program require payment in full by the financial institution to the supplier by the original maturity date of the invoice, or discounted payment at an earlier date as agreed upon with the supplier. The Company’s obligations to its suppliers, including amounts due and scheduled payment terms, are not impacted by a supplier’s participation in the SCF program.All outstanding amounts related to suppliers participating in the SCF program are recorded in accounts payable, trade in the consolidated balance sheets, and associated payments are included in operating activities in the consolidated statements of cash flows. The Company’s outstanding confirmed obligations included in accounts payable, trade in the consolidated balance sheets were $55.1 million as of December 31, 2023 and $44.2 million as of December 31, 2022.','null'),('0001433195','APPFOLIO INC','0',NULL,'null'),('0001618921','Walgreens Boots Alliance, Inc.','0',NULL,'null'),('0001603923','Weatherford International plc','0',NULL,'null'),('0001590955','Paycom Software, Inc.','0',NULL,'null'),('0001474735','GENERAC HOLDINGS INC.','0',NULL,'null'),('0000896622','APTARGROUP, INC.','0',NULL,'null'),('0001486957','BWX Technologies, Inc.','0',NULL,'null'),('0000750004','Light & Wonder, Inc.','0',NULL,'null'),('0001109354','BRUKER CORP','0',NULL,'null'),('0001433270','ANTERO RESOURCES Corp','0',NULL,'null'),('0001360901','Evercore Inc.','0',NULL,'null'),('0001116132','TAPESTRY, INC.','0',NULL,'null'),('0001579091','Maplebear Inc.','0',NULL,'null'),('0000764622','PINNACLE WEST CAPITAL CORP','0',NULL,'null'),('0001639438','CAVA GROUP, INC.','0',NULL,'null'),('0000802481','PILGRIMS PRIDE CORP','0',NULL,'null'),('0000888491','OMEGA HEALTHCARE INVESTORS INC','0',NULL,'null'),('0001174922','WYNN RESORTS LTD','0',NULL,'null'),('0001285785','MOSAIC CO','0',NULL,'null'),('0000034903','FEDERAL REALTY INVESTMENT TRUST','0',NULL,'null'),('0000049600','EASTGROUP PROPERTIES INC','0',NULL,'null'),('0001124140','EXACT SCIENCES CORP','0',NULL,'null'),('0001915657','HF Sinclair Corp','0',NULL,'null'),('0001357615','KBR, INC.','0',NULL,'null'),('0001820953','Affirm Holdings, Inc.','0',NULL,'null'),('0000071691','NEW YORK TIMES CO','0',NULL,