idated statements of cash flows. Amounts outstanding under this program were $3.8 million, $13.5 million and $24.0 million at December 31, 2023, 2022 and 2021, respectively, including $1.1 million, $3.5 million and $3.8 million, respectively, related to purchases of property, plant and equipment. Cash outflows under this program were $41.9 million, $64.6 million and $63.8 million for the years ended December 31, 2023, 2022 and 2021, respectively.We maintain a voluntary supply chain financing (\"SCF\") program with a global financial institution which allows a select group of suppliers to sell their receivables to the participating financial institution at the discretion of both parties on terms that are negotiated between the supplier and the financial institution. The supplier invoices that have been confirmed as valid under the program are paid by us to the financial institution according to the terms we have with the supplier. Amounts outstanding under the SCF program were $27.6 million and $29.8 million at December 31, 2023 and December 31, 2022, respectively. We also participate in a virtual card program with a global financial institution, in which we pay supplier invoices on the due date using a Virtual Card Account (\"VCA\") and subsequently pay the balance in full 25 days after the billing statement date of the VCA. The program allows for suppliers to receive an accelerated payment for a fee at each supplier\'s discretion. Fees paid by our suppliers are negotiated directly with the financial institution without our involvement. Amounts outstanding under the VCA program were $7.6 million and $6.8 million at December 31, 2023 and December 31, 2022, respectively.The payment terms we have with our suppliers who participate in the SCF and VCA programs are consistent with the typical terms we have with our suppliers who do not participate. These financing arrangements are included in accounts payable within the consolidated balance sheets and the associated payments are included in operating activities within the consolidated statements of cash flows.','null'),('0001562088','Duolingo, Inc.','0',NULL,'null'),('0001018963','ATI INC','0',NULL,'null'),('0000066570','MSA Safety Inc','0',NULL,'null'),('0001552275','Sunoco LP','0',NULL,'null'),('0000912767','UFP INDUSTRIES INC','0',NULL,'null'),('0000355811','GENTEX CORP','0',NULL,'null'),('0001701732','Altair Engineering Inc.','0',NULL,'null'),('0000089439','MUELLER INDUSTRIES INC','0',NULL,'null'),('0001493594','MACOM Technology Solutions Holdings, Inc.','0',NULL,'null'),('0001583708','SentinelOne, Inc.','0',NULL,'null'),('0001520006','Matador Resources Co','0',NULL,'null'),('0001467623','DROPBOX, INC.','0',NULL,'null'),('0000920371','Simpson Manufacturing Co., Inc.','0',NULL,'null'),('0000914208','Invesco Ltd.','0',NULL,'null'),('0001308547','Dolby Laboratories, Inc.','0',NULL,'null'),('0001021635','OGE ENERGY CORP.','0',NULL,'null'),('0001479094','STAG Industrial, Inc.','0',NULL,'null'),('0001560385','Liberty Media Corp','0',NULL,'null'),('0000764065','CLEVELAND-CLIFFS INC.','0',NULL,'null'),('0001423689','AGNC Investment Corp.','0',NULL,'null'),('0001602065','Viper Energy, Inc.','0',NULL,'null'),('0001115055','PINNACLE FINANCIAL PARTNERS INC','0',NULL,'null'),('0001581068','Brixmor Property Group Inc.','0',NULL,'null'),('0001833756','Leonardo DRS, Inc.','0',NULL,'null'),('0000824142','AAON, INC.','0',NULL,'null'),('0000730272','REPLIGEN CORP','0',NULL,'null'),('0000763901','POPULAR, INC.','0',NULL,'null'),('0000039263','CULLEN/FROST BANKERS, INC.','0',NULL,'null'),('0000908255','BORGWARNER INC','0',NULL,'null'),('0000880266','AGCO CORP /DE','1','SUPPLIER FINANCE PROGRAMS    The Company has supplier financing arrangements with certain banks or other intermediaries whereby a bank or intermediary purchases receivables held by the Company’s suppliers. Under the program, suppliers have the option to be paid by the bank or intermediary earlier than the payment due date. When the supplier receives an early payment, they receive discounted amounts, and the Company pays the bank or intermediary the face amount of the invoice on the payment due date. The Company does not reimburse suppliers for any costs incurred for participation in the program. The Company and its suppliers agree on the contractual terms, including prices, quantities and payment terms, regardless of whether the supplier elects to participate in the supplier finance programs. The suppliers’ voluntary inclusion in the supplier financing programs has no bearing on the Company’s payment terms. The Company has no economic interest in a supplier’s decision to participate in the programs, and the Company has no direct financial relationship with the banks or other intermediaries as it relates to the supplier finance programs. As of December 31, 2023, payment terms with the majority of the Company’s suppliers are generally 30 to 180 days, which correspond to the contractual terms, with rates that are based on market rates (such as SOFR) plus a credit spread. There are no assets pledged as security under the programs. As of December 31, 2023 and 2022, the amounts outstanding that remain unpaid to the banks or other intermediaries totaled $82.7 million and $121.5 million, respectively, and are reflected in “Accounts payable” in the Company’s Consolidated Balance Sheets.','null'),('0001321732','Penumbra Inc','0',NULL,'null'),('0000874015','IONIS PHARMACEUTICALS INC','0',NULL,'null'),('0001868778','Informatica Inc.','0',NULL,'null'),('0001021860','NOV Inc.','0',NULL,'null'),('0001411207','Allison Transmission Holdings Inc','0',NULL,'null'),('0001597264','Blueprint Medicines Corp','0',NULL,'null'),('0000772406','CIRRUS LOGIC, INC.','0',NULL,'null'),('0000936395','CIENA CORP','0',NULL,'null'),('0000775158','OSHKOSH CORP','0',NULL,'null'),('0000056047','KIRBY CORP','0',NULL,'null'),('0001842022','DT Midstream, Inc.','0',NULL,'null'),('0000921825','FIRST INDUSTRIAL REALTY TRUST INC','0',NULL,'