'null'),('0001794669','Shift4 Payments, Inc.','0',NULL,'null'),('0001877322','ESAB Corp','0',NULL,'null'),('0001046311','CHOICE HOTELS INTERNATIONAL INC /DE','0',NULL,'null'),('0001520697','Acadia Healthcare Company, Inc.','0',NULL,'null'),('0000899689','VORNADO REALTY TRUST','0',NULL,'null'),('0001653653','Red Rock Resorts, Inc.','0',NULL,'null'),('0001675149','Alcoa Corp','1','V. Supplier Finance ProgramsThe Company has various supplier finance programs with third-party financial institutions that are made available to suppliers to facilitate payment term negotiations. Under the terms of these agreements, participating suppliers receive payment in advance of the payment date from third-party financial institutions for qualifying invoices. Alcoa’s obligations to its suppliers, including amounts due and payment terms, are not impacted by its suppliers’ participation in these programs. The Company does not pledge any assets as security or provide any guarantees beyond payment of outstanding invoices at maturity under these arrangements. The Company does not pay fees to the financial institutions under these arrangements. At December 31, 2023 and December 31, 2022, qualifying supplier invoices outstanding under these programs were $104 and $185, respectively, and have payment terms ranging from 50 to 110 days. These obligations are included in Accounts payable, trade on the accompanying Consolidated Balance Sheet.','null'),('0000063276','MATTEL INC /DE/','1','Supplier Finance ProgramMattel has an agreement with a third-party financial institution that allows certain participating suppliers the opportunity to voluntarily finance payment obligations of Mattel under a supplier finance program. Under this program, participating suppliers may accelerate the timing of collection of their receivables due from Mattel, prior to their scheduled due dates, by selling one or more of their receivables at a discounted price to the third-party financial institution. The range of payment terms Mattel negotiates with suppliers are consistent, regardless of whether the suppliers participate in the supplier finance program and Mattel does not have any economic interest in any suppliers\' decision to participate in the supplier finance program. Suppliers participating in the program are able to select which individual Mattel invoices they sell to the third-party financial institution. However, all Mattel payments of the full amounts due to participating suppliers are paid on the invoice due date based on the terms originally negotiated with the supplier, regardless of whether the individual invoice due to the supplier is sold to the third-party financial institution. Included in Mattel\'s accounts payable in the consolidated balance sheets as of December 31, 2023 and 2022 were $54.3 million and $86.0 million of outstanding payment obligations due to suppliers, respectively, under the supplier finance program. All payment activities related to the supplier finance program were presented within operating activities in the consolidated statements of cash flows.','null'),('0001398659','Genpact LTD','0',NULL,'null'),('0001639300','Ollie\'s Bargain Outlet Holdings, Inc.','0',NULL,'null'),('0001496963','Squarespace, Inc.','0',NULL,'null'),('0001655888','Blue Owl Capital Corp','0',NULL,'null'),('0000009092','BADGER METER INC','0',NULL,'null'),('0001472787','First American Financial Corp','0',NULL,'null'),('0001860742','Bausch & Lomb Corp','0',NULL,'null'),('0000916540','DARLING INGREDIENTS INC.','0',NULL,'null'),('0001736035','Blackstone Secured Lending Fund','0',NULL,'null'),('0001711279','Krystal Biotech, Inc.','0',NULL,'null'),('0000277509','FEDERAL SIGNAL CORP /DE/','0',NULL,'null'),('0001157601','MADRIGAL PHARMACEUTICALS, INC.','0',NULL,'null'),('0001722684','WYNDHAM HOTELS & RESORTS, INC.','0',NULL,'null'),('0001477294','Sensata Technologies Holding plc','0',NULL,'null'),('0001674910','VALVOLINE INC','0',NULL,'null'),('0000098362','TIMKEN CO','0',NUL