ll'),('0001410384','Q2 Holdings, Inc.','0',NULL,'null'),('0001299709','Axos Financial, Inc.','0',NULL,'null'),('0001284812','COHEN & STEERS, INC.','0',NULL,'null'),('0001809104','Alight, Inc. / Delaware','0',NULL,'null'),('0000315709','INTERNATIONAL BANCSHARES CORP','0',NULL,'null'),('0000714310','VALLEY NATIONAL BANCORP','0',NULL,'null'),('0001869198','Life Time Group Holdings, Inc.','0',NULL,'null'),('0001122976','AVIENT CORP','0',NULL,'null'),('0001177609','FIVE BELOW, INC','0',NULL,'null'),('0001364885','Spirit AeroSystems Holdings, Inc.','1','The Company has provided certain suppliers with access to a supply chain financing program through facilities with third-party financing institutions. The Company’s suppliers’ ability to access the program is primarily dependent upon the strength of the Company’s financial condition and certain qualifying criteria. The program allows these suppliers to monetize their receivables prior to the contractual payment date, subject to a payment of a discount. The capacity of the program is limited to $127.5 at any point in time. If a supplier’s request exceeds the program limit, then it will be honored when capacity is available. Under the supply chain financing program, the Company agrees to pay the third-party financing institution the stated amount of confirmed invoices from its designated suppliers on the original maturity dates of the invoices, and suppliers have the ability to be paid from the third-party financing institution on an accelerated basis. The Company’s suppliers’ election to sell one or more of the Company’s confirmed obligations under the supply chain financing program is optional. The Company’s responsibility is limited to making payment on the terms originally negotiated with its suppliers for up to 120 days, regardless of whether the suppliers elect to sell their receivables to the third-party financing institution. Within the current population of qualified suppliers, there are no payment discounts offered or taken at any point by the financing institution or by the Company.  The Company or the third-party financing institution may terminate the agreement upon at least 45 days’ notice.The balance of confirmed obligations outstanding to suppliers who elect to participate in the supply chain financing program is included in the Company’s Accounts payable balance on the Company’s Consolidated Balance Sheets. The changes in each period primarily reflect purchases from suppliers related to production levels during the respective periods and are summarized as follows:','null'),('0001609550','Inspire Medical Systems, Inc.','0',NULL,'null'),('0001515673','Ultragenyx Pharmaceutical Inc.','0',NULL,'null'),('0001031203','GROUP 1 AUTOMOTIVE INC','0',NULL,'null'),('0001676238','Braze, Inc.','0',NULL,'null'),('0001579428','Axsome Therapeutics, Inc.','0',NULL,'null'),('0001280058','BLACKBAUD INC','1',NULL,'[[\"(dollars in thousands)\", \"Total\"], [\"Balance at December 31, 2022\", \"$\", \"2,247\", \"\"], [\"Additions\", \"2,491\", \"\"], [\"Payments\", \"(1,938)\", \"\"], [\"Balance at December 31, 2023\", \"$\", \"2,800\", \"\"]]'),('0001476765','GOLUB CAPITAL BDC, Inc.','0',NULL,'null'),('0001111928','IPG PHOTONICS CORP','0',NULL,'null'),('0000886346','KADANT INC','0',NULL,'null'),('0000860748','KEMPER Corp','0',NULL,'null'),('0000897723','SANMINA CORP','0',NULL,'null'),('0001764013','Immunovant, Inc.','0',NULL,'null'),('0000889900','PATTERSON UTI ENERGY INC','0',NULL,'null'),('0001576280','Guardant Health, Inc.','0',NULL,'null'),('0001258602','NELNET INC','0',NULL,'null'),('0001230245','PIPER SANDLER COMPANIES','0',NULL,'null'),('0001307954','Huntsman CORP','0',NULL,'null'),('0000910073','NEW YORK COMMUNITY BANCORP, INC.','0',NULL,'null'),('0001130464','BLACK HILLS CORP /SD/','0',NULL,'null'),('0001811414','QuantumScape Corp','0',NULL,'null'),('0000827876','CLEANSPARK, INC.','0',NULL,'null'),('0001466593','Otter Tail Corp','0',NULL,'null'),('0001311370','Lazard, Inc.','0',NULL