y and issue the associated invoices to the Company based on the agreed-upon contractual terms. Suppliers that participate in the SCF Program, at their sole discretion, determine which invoices, if any, they want to sell to the financial institution. The suppliers’ voluntary inclusion of invoices in the SCF Program does not change the Company’s existing contractual terms with its suppliers. The Company does not provide any guarantees under the SCF Program, nor does it have any economic interest in a supplier’s decision to participate in the SCF Program as of December 31, 2023.','null'),('0001085869','PERFICIENT INC','0',NULL,'null'),('0000895419','WOLFSPEED, INC.','0',NULL,'null'),('0001834488','N-able, Inc.','0',NULL,'null'),('0001603145','NEXTERA ENERGY PARTNERS, LP','0',NULL,'null'),('0000913760','StoneX Group Inc.','0',NULL,'null'),('0000107140','JOHN WILEY & SONS, INC.','0',NULL,'null'),('0001509991','Kosmos Energy Ltd.','0',NULL,'null'),('0001576427','Criteo S.A.','0',NULL,'null'),('0001827090','Certara, Inc.','0',NULL,'null'),('0001039065','OSI SYSTEMS INC','0',NULL,'null'),('0001441683','APPIAN CORP','0',NULL,'null'),('0001809987','Mirion Technologies, Inc.','0',NULL,'null'),('0000215466','Coeur Mining, Inc.','0',NULL,'null'),('0001591587','AssetMark Financial Holdings, Inc.','0',NULL,'null'),('0000887359','Vericel Corp','0',NULL,'null'),('0001101215','BREAD FINANCIAL HOLDINGS, INC.','0',NULL,'null'),('0000899923','MYRIAD GENETICS INC','0',NULL,'null'),('0001569345','Sprinklr, Inc.','0',NULL,'null'),('0001070081','PTC THERAPEUTICS, INC.','0',NULL,'null'),('0001921963','Atmus Filtration Technologies Inc.','0',NULL,'null'),('0000708955','FIRST FINANCIAL BANCORP /OH/','0',NULL,'null'),('0001579877','OUTFRONT Media Inc.','0',NULL,'null'),('0000914156','UFP TECHNOLOGIES INC','0',NULL,'null'),('0001526520','TripAdvisor, Inc.','0',NULL,'null'),('0001345016','YELP INC','0',NULL,'null'),('0001611547','Urban Edge Properties','0',NULL,'null'),('0000744218','Celldex Ther