any participates in a Supplier Finance Program (the \"Program\") under which it agrees to pay a third-party finance provider the stated amount of confirmed invoices from participating suppliers based on the original invoice due date. Suppliers, at their sole discretion, may elect to finance confirmed invoices prior to their scheduled due date at a discounted price with the Company\'s third-party finance provider. Outstanding obligations related to the Program were not material as of December 31, 2023 and 2022. These obligations were recorded within Accounts Payable on the Consolidated Balance Sheets. The Company does not have any assets nor any other forms of guarantees pledged as security to the third-party finance provider as part of the Program.','null'),('0001060822','CARTERS INC','1','SUPPLIER FINANCE PROGRAMWe have established a voluntary supply chain finance (“SCF”) program through participating financial institutions. This SCF program enables participating suppliers to accelerate payments for receivables due from the Company by selling them directly to the participating financial institutions at their discretion. As of December 30, 2023, the SCF program has a $70.0 million revolving capacity. We are not a party to the agreements between the participating financial institutions and the suppliers in connection with the SCF program. Payment terms for most of our suppliers are 60 days, regardless of participation in the SCF program. The Company does not provide any guarantees under the SCF program.The Company’s liability related to amounts payable to the participating financial institution for suppliers who voluntarily participate in the SCF program are included in Accounts payable on our consolidated balance sheets. As of December 30, 2023 and December 31, 2022, amounts under the SCF program included in Accounts payable were $14.8 million and $16.5 million, respectively. Payments made in connection with the SCF program, like payments of other accounts payable, 